$Size_Limit = "10 GB"

$Folder_Path = (New-Object -ComObject Shell.Application).NameSpace('shell:Downloads').Self.Path
$Folder_Size = (Get-ChildItem -LiteralPath $Folder_Path -File -Force -Recurse -ErrorAction SilentlyContinue | Measure-Object -Property Length -Sum).Sum

# Toast title
$Title = "Your Download folder hast more than $Size_Limit of data"

# Toast text
$Message = "`nDownload folder size:"
$Advice = "`nPlease consider cleaning it up or moving the data to your Documents. The data in this folder is not protected or backed up."
$Text_AppName = "Information"

# Buttons to display in the toast: set $True or $False
$Button_Open_show = $True # It will add a button to open the Recycle bin
$Button_Clear_show = $True # It will add a button to clear the Recycle bin

# Image header format base 64 (728px x 360px) --> https://codebeautify.org/image-to-base64-converter 
$Picture_Base64 = ""


#**********************************************************************************************************
# export images
#**********************************************************************************************************

# Chemin d'exportation de l'image header
$HeroImage = "$env:TEMP\HeroPicture.png"
[byte[]]$Bytes = [convert]::FromBase64String($Picture_Base64)
[System.IO.File]::WriteAllBytes($HeroImage,$Bytes)	


Function Register-NotificationApp($AppID,$AppDisplayName) {
    [int]$ShowInSettings = 0

    [int]$IconBackgroundColor = 0
	$IconUri = "C:\Windows\ImmersiveControlPanel\images\logo.png"
	
    $AppRegPath = "HKCU:\Software\Classes\AppUserModelId"
    $RegPath = "$AppRegPath\$AppID"
	
	$Notifications_Reg = 'HKCU:\SOFTWARE\Microsoft\Windows\CurrentVersion\Notifications\Settings'
	If(!(Test-Path -Path "$Notifications_Reg\$AppID")) 
		{
			New-Item -Path "$Notifications_Reg\$AppID" -Force
			New-ItemProperty -Path "$Notifications_Reg\$AppID" -Name 'ShowInActionCenter' -Value 1 -PropertyType 'DWORD' -Force
		}

	If((Get-ItemProperty -Path "$Notifications_Reg\$AppID" -Name 'ShowInActionCenter' -ErrorAction SilentlyContinue).ShowInActionCenter -ne '1') 
		{
			New-ItemProperty -Path "$Notifications_Reg\$AppID" -Name 'ShowInActionCenter' -Value 1 -PropertyType 'DWORD' -Force
		}	
		
    try {
        if (-NOT(Test-Path $RegPath)) {
            New-Item -Path $AppRegPath -Name $AppID -Force | Out-Null
        }
        $DisplayName = Get-ItemProperty -Path $RegPath -Name DisplayName -ErrorAction SilentlyContinue | Select-Object -ExpandProperty DisplayName -ErrorAction SilentlyContinue
        if ($DisplayName -ne $AppDisplayName) {
            New-ItemProperty -Path $RegPath -Name DisplayName -Value $AppDisplayName -PropertyType String -Force | Out-Null
        }
        $ShowInSettingsValue = Get-ItemProperty -Path $RegPath -Name ShowInSettings -ErrorAction SilentlyContinue | Select-Object -ExpandProperty ShowInSettings -ErrorAction SilentlyContinue
        if ($ShowInSettingsValue -ne $ShowInSettings) {
            New-ItemProperty -Path $RegPath -Name ShowInSettings -Value $ShowInSettings -PropertyType DWORD -Force | Out-Null
        }
		
		New-ItemProperty -Path $RegPath -Name IconUri -Value $IconUri -PropertyType ExpandString -Force | Out-Null	
		New-ItemProperty -Path $RegPath -Name IconBackgroundColor -Value $IconBackgroundColor -PropertyType ExpandString -Force | Out-Null		
		
    }
    catch {}
}


Function Set_Action
	{
		param(
		$Action_Name		
		)	
		
		$Main_Reg_Path = "HKCU:\SOFTWARE\Classes\$Action_Name"
		$Command_Path = "$Main_Reg_Path\shell\open\command"
		$CMD_Script = "C:\Windows\Temp\$Action_Name.cmd"
		New-Item $Command_Path -Force
		New-ItemProperty -Path $Main_Reg_Path -Name "URL Protocol" -Value "" -PropertyType String -Force | Out-Null
		Set-ItemProperty -Path $Main_Reg_Path -Name "(Default)" -Value "URL:$Action_Name Protocol" -Force | Out-Null
		Set-ItemProperty -Path $Command_Path -Name "(Default)" -Value $CMD_Script -Force | Out-Null		
	}
	
Set_Action -Action_Name OpenFolder


$OpenFolder_Script = @"
start $Folder_Path
"@


$ClearFolder_Script = @"
powershell -command Remove-Item "$Folder_Path\*" -Recurse -Force
"@

$Script_Export_Path = "C:\Windows\Temp"

If($Button_Open_show -eq $True)
	{
		$OpenFolder_Script | out-file "$Script_Export_Path\OpenFolder.cmd" -Force -Encoding ASCII
		Set_Action -Action_Name OpenFolder	
	}

If($Button_Clear_show -eq $True)
	{
		$ClearFolder_Script | out-file "$Script_Export_Path\ClearFolder.cmd" -Force -Encoding ASCII
		Set_Action -Action_Name ClearFolder		
	}



#**************************************************************************************************************************
# 													MAIN CODE
#**************************************************************************************************************************

Function Format_Size
	{
		param(
		$size	
		)	
		
		$suffix = "B", "KB", "MB", "GB", "TB", "PB", "EB", "ZB", "YB"
		$index = 0
		while ($size -gt 1kb) 
		{
			$size = $size / 1kb
			$index++
		} 

		"{0:N2} {1}" -f $size, $suffix[$index]
	}
	
$Folder_FormatedSize = Format_Size $Folder_Size
$Message = $Message + " " + $Folder_FormatedSize

#**************************************************************************************************************************
# 													MAIN CODE
#**************************************************************************************************************************


#**************************************************************************************************************************
# 													TOAST NOTIF PART
#**************************************************************************************************************************

$Action_Open = "OpenFolder:"
$Action_Clear = "ClearFolder:"

If(($Button_Open_show -eq $True) -and ($Button_Clear_show -eq $True))
	{
		$Actions = 
@"
  <actions>
        <action activationType="protocol" arguments="$Action_Open" content="Open" />		
        <action activationType="protocol" arguments="$Action_Clear" content="Delet all" />		  
        <action activationType="protocol" arguments="Dismiss" content="Ignore" />
   </actions>	
"@		
	}
ElseIf(($Button_Open_show -eq $True) -and ($Button_Clear_show -eq $False))
	{
		$Actions = 
@"
  <actions>
        <action activationType="protocol" arguments="$Action_Open" content="Open" />		
        <action activationType="protocol" arguments="Dismiss" content="Ignore" />
   </actions>	
"@		
	}	
ElseIf(($Button_Open_show -eq $False) -and ($Button_Clear_show -eq $True))
	{
		$Actions = 
@"
  <actions>
        <action activationType="protocol" arguments="$Action_Clear" content="Open" />		  
        <action activationType="protocol" arguments="Dismiss" content="Ignore" />
   </actions>	
"@		
	}	
ElseIf(($Button_Open_show -eq $False) -and ($Button_Clear_show -eq $False))
	{
		$Actions = 
@"
  <actions>
        <action activationType="protocol" arguments="Dismiss" content="Ignore" />
   </actions>	
"@		
	}	

$Scenario = 'reminder' 

[xml]$Toast = @"
<toast scenario="$Scenario">
    <visual>
    <binding template="ToastGeneric">
        <image placement="hero" src="$HeroImage"/>
        <text>$Title</text>
        <group>
            <subgroup>     
                <text hint-style="body" hint-wrap="true" >$Message</text>
            </subgroup>
        </group>
		
		<group>				
			<subgroup>     
				<text hint-style="body" hint-wrap="true" >$Advice</text>								
			</subgroup>				
		</group>				
    </binding>
    </visual>
	$Actions
</toast>
"@	


$AppID = $Text_AppName
$AppDisplayName = $Text_AppName
Register-NotificationApp -AppID $Text_AppName -AppDisplayName $Text_AppName

# Toast creation and display
$Load = [Windows.UI.Notifications.ToastNotificationManager, Windows.UI.Notifications, ContentType = WindowsRuntime]
$Load = [Windows.Data.Xml.Dom.XmlDocument, Windows.Data.Xml.Dom.XmlDocument, ContentType = WindowsRuntime]
$ToastXml = New-Object -TypeName Windows.Data.Xml.Dom.XmlDocument
$ToastXml.LoadXml($Toast.OuterXml)	
# Display the Toast
[Windows.UI.Notifications.ToastNotificationManager]::CreateToastNotifier($AppID).Show($ToastXml)
